import mongo from 'mongodb'
import connect from './db'
import bcrypt from 'bcrypt'
import jwt from 'jsonwebtoken'
import { verify } from 'crypto';

(async () => {
    let db = await connect();
    db.collection('users').createIndex({ username: 1 }, { unique: true });
})();


export default {
    async register(userData){
        let db = await connect()
        
        let user = {
            email: userData.email,
            password: await bcrypt.hash(userData.password, 8),
            name: userData.name,
            surname: userData.surname,
            accountType: userData.account_type
            
        }

        try{
            let insertResult = await db.collection("users").insertOne(user);
            if(insertResult && insertResult.insertedId){
                return insertResult.insertedId
            }
        }
        catch(e){
            if (e.name =="MongoError" && e.code == 11000){
                throw new Error("User already exists")
            }
        }   
    },


    async authenticateUser(username,password){
        let db = await connect()
        let user = await db.collection("users").findOne({username : username})

        // provjerava da li je ovaj hesh u bazi izveden iz cistog passworda
        if(user && user.password && (await bcrypt.compare(password, user.password))){
            //ifra za potpisivanje korisnika(kriptografski potpis) veemo je uz na backend, s tom ifrom potpisujemo 
            //tokene svih korisnika, kad nam korisnik vraa token provjeravamo da li je on potpisan s naom ifrom
            //na token sadri sve podatke o useru
            //password nije potrebno spremati u token jer smo ga ve provjerili
            delete user.password
            let token = jwt.sign(user, process.env.JWT_SECRET, {
                algorithm: "HS512",
                expiresIn: "1 week"
            })

            return{
                token,
                username : user.username
            }

        }
        else {
            throw new Error('Cannot authenticate')
        }
    },

    //ako nam verify prode zovemo next, ako ne prode javljamo gresku
    async verify(req,res, next){
        try{
            let authorization = req.headers.authorization.split(' ')
            let type = authorization[0]
            let token = authorization[1]
    
            if (type != 'Bearer'){
                console.log('type:' + type)
                res.status(401).send()
                return false;
            }
            else {
                //spremati u jwt kljuc podatke u korisniku da se moze na bilo kojem mjestu
                //koristiti ti podaci o korisniku -> da se zna ko salje upit itd
                req.jwt = jwt.verify(token, process.env.JWT_SECRET)
                return next()
            }
        }
        catch(e){
            return res.status(401).send()
        }
    }

}
